import './CarouselItem.css';
import {CaroselJson} from './CarouselJson';


class CarouselItem extends React.Component{
    
    render(){
           
            CaroselJson.map(item=>
                {
                return(            
                    <img className="cItem" src={item.imagePath}/>                   
                );
            })
        }

    }
